<template>
	<view class="login-wrap">
		<view class="login-header"></view>
		<view class="login-form">
			<view class="login-form-item">
				<input type="text" class="input" autocomplete="off" placeholder="请输入账号" v-model="username" />
			</view>
			<view class="login-form-item">
				<input type="text" :password="true" class="input" autocomplete="off" placeholder="请输入密码" v-model="password" />
			</view>
			<button class="btn" @click="handleLogin">登 入</button>
		<!-- 	<view class="login-other">
				<view @click="handleRegister">快速注册</view>
			</view> -->
		</view>
	</view>
</template>

<script>
	import {
		mapState,
		mapActions
	} from 'vuex';
	export default {
		data() {
			return {
				username: 'admin',
				password: 'admin@123456',
			};
		},
		computed: {
			...mapState('user', ['userinfo', 'token']),
		},
		methods: {
			...mapActions('user', ['getUserinfo', 'getToken']),
			async handleLogin() {
				console.log(11111)
				if (!this.username) {
					uni.showToast({
						title: '请输入账号',
						icon: 'none',
					});
				}
				if (!this.password) {
					uni.showToast({
						title: '请输入密码',
						icon: 'none',
					});
				}
				uni.showLoading({
					mask: true
				});
				const token = await this.getToken({
					username: this.username,
					password: this.password,
				});
				if (token) {
					uni.showToast({
						title: '登录成功'
					});
					await this.getUserinfo();
					uni.switchTab({
						url: '/pages/community-serv/communityServ'
					});
				}

				uni.hideLoading();
			},
			handleVisit() {
				uni.switchTab({
					url: '/pages/community-serv/communityServ',
				})
			},
			handleRegister() {
				uni.navigateTo({
					url: './register'
				});
			},
		},
	};
</script>

